To the many that have used your voices to amplify Black Business and Black Voices, thank you! .
Thank you for personally inspiring me and giving me the courage to speak up. Honestly, since taking over AOSA Coffee; I have lacked the courage to embrace being an owner, especially a young-black-female-small-business owner.  It's encouraging to be able to support other black owners through the time and research done by you all within our community. Thank you for continuing to be world changers. .
Keep using your voices and platforms to lift up and bring justice to black lives!  And thank you for providing to me a much needed community. - Key ‚úäüèø
